import React, { Component } from 'react'
import axios from 'axios'
import CircularProgress from '@material-ui/core/CircularProgress';



export class Handler extends Component {

    constructor(props) {
        super(props);

        this.state = {
            lvl: props.lvl,
            row : [],
            columns : [],
            seen: false,
        }
    }

    renderSwitch(param) {
        switch (param) {
            case 'Level 2':
                break;
            case 'Level 3':
                break;
            default:
                <div>hello</div>
                break;
        }
    }


    render() {
        if(!this.state.seen){
            <CircularProgress disableShrink />;
        }
        else{
            return (
            <div>
                {this.renderSwitch(this.state.lvl)}

            </div>
        )
            }
    }

    componentDidMount(){
        if(!this.state.seen){
            axios.post('http://localhost:8080/1729197/logus?user=' + this.state.userName + '&' + 'password=' + this.state.passWord, {
             })
                .then((response) => {
                    console.log(response);
            }
            )
        }
    }
}

export default Handler
